exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.x999xs.com/files/article/html/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions)},preprocess:html=>html.replace(/<dl><\/dl>/g,"")})};